  return (
   <div style={{
       padding:"100px 200px",
   }}>
       <input type="text" placeholder={"Write your todo here"}
       onChange={(e) => setTodo(e.target.value)}/>
       <button onClick={() => todoStore.addTodo(todo)}> add todo</button>
     <Todo  text={"HaHa i`m just testing"} id ={1}/>
   </div>
  );
}

export default App;
